import React, { createContext, useState } from 'react';
import { dummyProducts } from '../service/dummy';

interface AppContextInterface {
  id: any;
  name: any;
  price: any;
  photo: any;
}



export const ProductsContext = React.createContext<AppContextInterface | null>(null);

export function ProductsContextProvider({children}: any) {


  let aaa: AppContextInterface = dummyProducts;

  aaa  = dummyProducts || [];


  return ( 
    <ProductsContext.Provider value={{aaa}} >
        { children }
    </ProductsContext.Provider>
 );
};
